import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './components/header/Header';
import Body from './components/body/Body';
import Footer from './components/footer/Footer';

import Archives from './routes/archives/Archives';
import Whoami from './routes/whoami/Whoami';


import { Route, Link, BrowserRouter as Router } from 'react-router-dom'



const home = () => <Body />;
const archive = () => <Archives />;
const whoami = () => <Whoami />;





function App() {
  return (
    <center>
    <div className="App" style={{ width:'800px'  }}>
    <Router>
  <div>
    <ul>
      <li><Link to="/">Home</Link></li>
      <li><Link to="/about">About</Link></li>
      <li><Link to="/contact">Contact</Link></li>
    </ul>
    <hr/>

    // All 3 components below would be rendered when in a homepage
    <Route exact path="/" component={home}/>
    <Route exact path="/" component={archive}/>
    <Route exact path="/" component={whoami}/>
  </div>
</Router>





    </div>
    </center>
  );
}

export default App;
